import React from 'react';
import { 
    IonBackButton,
    IonButton,
    IonButtons, 
    IonIcon
} from '@ionic/react';
import { returnDownBack } from 'ionicons/icons';


export const BackBtn: React.FC = () => {
    <IonButtons slot="end">
        <IonBackButton text="">
            <IonIcon slot="icon-only" icon={returnDownBack}></IonIcon>
        </IonBackButton>
    </IonButtons>
}

export default BackBtn;
